import{_ as a,c as t,o as _,ah as i,av as s,aw as r,ax as e,ay as g,az as o,aA as m,aB as h,aC as l,aD as c,aE as n,aF as b,aG as d,aH as u,aI as f,aJ as j,aK as G,aL as k,aM as S}from"./chunks/framework.fGMAYWSH.js";const A=JSON.parse('{"title":"github创建仓库","description":"","frontmatter":{},"headers":[],"relativePath":"git/note2.md","filePath":"git/note2.md"}'),y={name:"git/note2.md"};function T(P,p,x,H,$,B){return _(),t("div",null,[...p[0]||(p[0]=[i('<h1 id="github创建仓库" tabindex="-1">github创建仓库 <a class="header-anchor" href="#github创建仓库" aria-label="Permalink to “github创建仓库”">​</a></h1><p>先去github创建一个自己的仓库</p><p><img src="'+s+'" alt="2025_11_21_12_18_32.jpg">去Git的官网安装适合自己电脑的版本</p><p><strong>Gitbash</strong></p><h2 id="获取密钥" tabindex="-1">获取密钥 <a class="header-anchor" href="#获取密钥" aria-label="Permalink to “获取密钥”">​</a></h2><p>首先要在本地创建一个ssh key ，这个的目的就是你现在需要在你电脑上获得一个密匙，获取之后，在你的GitHub账号里边输入之后，你的电脑就和你的GitHub账号联系在一起了，这样以后就可以十分方便的通过Git bash 随时上传你的代码。</p><p>双击打开gitbash，命令框里输入以下命令：</p><p>$ ssh-keygen -t rsa -C “your email@.com”</p><p>注释：此处youremail@.com为你注册github时的邮箱</p><p>出现如图所示界面：</p><p><img src="'+r+'" alt="2025_11_21_11_34_32.jpg"></p><p>说明你的密匙已经成功创建了，现在打开上述的存储.ssh文件的位置，打开id_rsa.pub或是id_rsa文件，复制里面的内容（秘钥）：</p><p><img src="'+e+'" alt="2025_11_21_11_46_04.jpg"></p><p>注释：打开id_rsa.pub或是id_rsa文件，打开方式为记事本</p><p><img src="'+g+'" alt="2025_11_21_11_47_02.jpg"></p><p>注释：每个人密钥都不一样哦</p><p>如果没有显示密钥位置，自己手动去找，可以在c盘/users/用户名称（id）/.shh</p><p>找到带.ssh的文件点进去就可以看到了<img src="'+o+'" alt="截图"> 如图打开中间下面的文件拓展名和隐藏的项目</p><p>打开自己的github</p><p><img src="'+m+'" alt="2025_11_21_12_30_01.jpg"></p><p>找到SSH and GPG keys这个选项之后，在网页右上角点击new SSH Key按钮创建秘钥，title是你给你的秘钥起一个标题，key里面就把你刚才复制的秘钥粘贴进去，点击add SSH KEY就可以了：</p><p><img src="'+h+'" alt="截图"></p><p>之后再回到Git Bash，输入命令：$ ssh -T <a href="mailto:git@github.com" target="_blank" rel="noreferrer">git@github.com</a> ，再输入yes, 出现如下界面，就说明链接成功了</p><p><img src="'+l+'" alt="2025_11_21_12_35_02.jpg"></p><p>接下来还需要设置一些账号名，邮箱（email是一定要是注册GitHub的那个邮箱地址）</p><p><img src="'+c+'" alt="2025_11_21_12_38_01.jpg"></p><p><img src="'+n+'" alt="2025_11_21_12_38_56.jpg"></p><p>下面就要将你在github上创建的仓库克隆到你的本地来，方便以后进行代码上传。</p><p>打开你所创建的仓库：</p><p><img src="'+b+'" alt="2025_11_21_12_59_51.jpg"></p><p>然后再打开Git Bash,将自己的文件存储定位在一个你代码所要存储的位置，在这里，我将定位在D盘当中</p><h3 id="将文件上传到仓库" tabindex="-1">将文件上传到仓库 <a class="header-anchor" href="#将文件上传到仓库" aria-label="Permalink to “将文件上传到仓库”">​</a></h3><p>出现如下界面，说明定位成功。</p><p><img src="'+d+'" alt="2025_11_21_13_03_03.jpg"></p><p>之后开始克隆一个仓库到本地：</p><p>git clone <a href="https://github.com/tzf6666/TZf6666.github.io.git" target="_blank" rel="noreferrer">https://github.com/tzf6666/TZf6666.github.io.git</a></p><p>之后打开你所定位的D盘，就会出现一个跟你远程仓库一样的仓库文件夹：</p><p><img src="'+u+'" alt="13.jpg"></p><p>打开这个文件夹，随意的创建一个文件，（在这个文件夹下你就可以上传代码了，在这里我保存了一个文件）</p><p>然后输入：ls命令，查看你目前所定位的文件夹中的文件：</p><p><img src="'+f+'" alt="14.jpg"></p><p>然后输入命令：git add 文件名,引号里面是你所要上传的文件名称或者</p><p><img src="'+j+'" alt="15.jpg"></p><p>然后在输入：git commit -m “描述内容，备注” ,输入之后出现以上情况（要有新的未上传的文件）:</p><p><img src="'+G+'" alt="截图"></p><p>然后在输入：git push origin master</p><p><img src="'+k+'" alt="17.jpg"></p><p>出现上面界面，表示已经成功了。现在打开你的Github网站，找到你所创建的库：</p><p><img src="'+S+'" alt="18.jpg"></p>',49)])])}const C=a(y,[["render",T]]);export{A as __pageData,C as default};
